import React  from 'react';
import EN from '../../../constant/en';
import { Radio } from 'antd';
import styles from './AdvancedView.module.css';
const randomlyImg = 'data:image/svg+xml;base64,'
const yAxisUnbalancedImg = 'data:image/svg+xml;base64,'
const xAxisUnbalancedImg = 'data:image/svg+xml;base64,'
const outliersImg = 'data:image/svg+xml;base64,'
const nonlinearImg = 'data:image/svg+xml;base64,'
const heteroscedasticityImg = 'data:image/svg+xml;base64,'
const largeImg = 'data:image/svg+xml;base64,'

interface Interface {
  diagnoseType:any
  handleDiagnoseType:any
  Plot:any
}

export default function ResidualDiagnose(props:Interface){
  const {handleDiagnoseType,Plot,diagnoseType} = props;
    const plots = [{
      plot: randomlyImg,
      type: 'random',
      text: EN.RandomlyDistributed
    }, {
      plot: yAxisUnbalancedImg,
      type: 'yUnbalanced',
      text: EN.YaxisUnbalanced
    }, {
      plot: xAxisUnbalancedImg,
      type: 'xUnbalanced',
      text: EN.XaxisUnbalanced
    }, {
      plot: outliersImg,
      type: 'outliers',
      text: EN.Outliers
    }, {
      plot: nonlinearImg,
      type: 'nonlinear',
      text: EN.Nonlinear
    }, {
      plot: heteroscedasticityImg,
      type: 'heteroscedasticity',
      text: EN.Heteroscedasticity
    }, {
      plot: largeImg,
      type: 'largey',
      text: EN.LargeYaxisDataPoints
    }];
    const RadioGroup = Radio.Group;
    return (
      <div className={styles.residualDiagnose} >
        <div className={styles.plot} style={{ zoom: 0.7 }}>
          {Plot}
        </div>
        <div className={styles.choosePlot} >
          <div>{EN.Whichplotdoesyourresidual}</div>
          <RadioGroup value={diagnoseType} onChange={handleDiagnoseType} >
            {plots.map((p, i) => (
              <div className={styles.radioWrapper} key={i}>
                <Radio value={p.type} >{p.text}</Radio>
                <div>
                  <img width={200} src={p.plot} alt='plot' />
                </div>
              </div>
            ))}
          </RadioGroup >
        </div>

      </div>
    );
}
